import { useParams } from 'react-router-dom';

const About = () => {
  const { id } = useParams();

  return (
    <main className="section">
      <div className="container">
      <h1 style={{ fontSize: 24 }}>About</h1><br>
      </br>
        <p>This is text name</p>
      </div>
    </main>
  );
};
export default About;
